webpackJsonp([0x9553a2b9f12a],{1268:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/shottts-dribbble-for-the-blackberry-playbook/index.md absPath of file >>> MarkdownRemark",html:'<img class="alignnone size-full wp-image-1294" title="The Shottts Logo" src="http://uploads.psyked.co.uk/2011/05/shottts-logo.png" alt="" width="500" height="280">\n<p><a title="View the Shottts application on the BlackBerry App World website." href="http://appworld.blackberry.com/webstore/content/30821" target="_blank">Shottts</a> is an AIR application developed for the <a title="Read more about the Playbook Tablet" href="http://uk.blackberry.com/playbook-tablet/" target="_blank">BlackBerry Playbook Tablet</a>, developed by Mark Starling, of <a title="Open http://markstar.co.uk in a new window." href="http://markstar.co.uk" target="_blank">http://markstar.co.uk</a> fame.</p>\n<p>Shottts loads and displays a selection of the most recent updates from <a title="Open the most popular shots from Dribbble in a new window." href="http://dribbble.com/shots/popular/" target="_blank">Dribbble</a>, and displays them in a nice, touch screen interface. I happen to know that earlier desktop versions of the Shottts application were kicking about privately before BlackBerry launched their submit-an-app-get-a-free-Playbook contest, so its nice to see the app finally go live!</p>\n<p>And once those Playbook devices go on sale over in the UK, and Mark can actually get his mitts on a physical device, I\'m sure we\'ll see more application updates. <a title="Read more about the release of Shottts at markstar.co.uk" href="http://markstar.co.uk/blog/2011/flashplatform/actionscript/shottts-is-now-available-in-the-blackberry-app-store/" target="_blank">You can read more from Mark about Shottts in his announcement blog post.</a></p>\n<p>If you\'ve got a Playbook, I\'d suggest you <a title="Download Shottts from the BlackBerry App World store." href="http://appworld.blackberry.com/webstore/content/30821" target="_blank">check out Shottts</a>!</p>',frontmatter:{title:"Shottts - Dribbble for the BlackBerry Playbook",date:"May 09, 2011",tags:["air","blackberry","dribbble","playbook","shottts"]}}},pathContext:{}}}});
